import { Button } from '@material-ui/core';
import React, { useState, useEffect } from 'react';



export const UserDashboard = () => {

    const [profile, setProfile] = useState(false);
    const [list, setList] = useState(false)


    const profileHandler = () => {
        if (profile != true) {
            setProfile(true)
            setList(false)
        } else {
            setProfile(false)

        }
    }
    const listHandler = () => {
        if (list != true) {
            setList(true)
            setProfile(false)
        } else {
            setList(false)
        }

    }


    return (
        <>
            <div className="falla">
                <div className="user">
                    <div className="userDashboard">
                        <div className="userProfile">
                            {profile != true && <div onClick={profileHandler} className={`userBack ${profile && 'openProfile'}`}>
                                <p>TUPERFIL</p>
                            </div>}
                            {profile && <div className={`userBack ${profile && 'openProfile'}`}>
                                <p onClick={profileHandler}>TUPERFIL</p>
                            </div>}

                        </div>
                        <div className="userProfile">
                            {list != true && <div onClick={listHandler} className={`userBack ${list && 'openProfile'}`}>
                                <p><span className="paseSide">TU</span> <span className="carnavalSide"> LISTA</span></p>
                            </div>}
                            {list && <div className={`userBack ${list && 'openProfile'}`}>
                                <span onClick={listHandler}><p className="paseSide">TU</p> <p className="carnavalSide"> LISTA</p></span>
                            </div>}

                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}
